import React from 'react';



const CreatureCard = ({ name, location, price }) => {
    return (
        <div style={{
            width: ""
        }}>
            <h1
                className="creature-name">
                {name}
            </h1>

            <p
                className="location">
                Location: {location}
            </p>

            <p className="price">
            Price: {price} 
            </p>

        </div>
    );
};


export default CreatureCard;
